Studio  RATED X
Release Date  October 1, 1977
Category  Classic, Adult
Director  Joel Scott
Starring  Abigail Clayton, Amber Hunt, Annette Haven, Lesllie Bovee, Suzanne McBain, Eric Edwards, Jamie Gillis, John Leslie 

You're in for a hot and juicy joyride of steamy, sizzling sex when you witness the amorous adventures of three gorgeous angels. When one of their own is kidnapped by an insidious white-slaver, Heavenly Annette Haven leads the passionate pack on a randy rampage of undercover activity. These naughty nymphs have a shocking arsenal of torrid tricks to get what they want...and if they don't - watch out! With these hot girl-girl encounters you'll find these angels use their bodies just as well as their minds!
